import { Modal, ModalHeader, ModalBody, ModalFooter, Spinner,TabContent, TabPane, Nav, NavItem, NavLink, Card,CardImg, Button, CardTitle, CardBody, CardText, Row, Col, Container } from 'reactstrap';
import React, {useState} from 'react';
import classnames from 'classnames';
class Diagnosis extends React.Component{
	constructor(props){
		super(props);
		this.state = {
		}
	}
	render(){
		return(
			<div>
				{this.props.currentState.showModalDiagnosis && <ModalDiagnosis handlerSuper={()=>{this.props.handler("OnConnection")}} thumbnail={this.props.thumbnail}/>}
			</div>
		);
	}
}

const ModalDiagnosis= (props) => {
  const {
    className,
    thumbnail
  } = props;

  console.log(thumbnail);
  const [modal, setModal] = useState(true);

  const toggle = () => {
  	setModal(!modal);
		props.handlerSuper();
	}

	const [activeTab, setActiveTab] = useState('1');
  const toggle2 = tab => {
    if(activeTab !== tab) setActiveTab(tab);
  }
  return (
    <div>
      <Modal isOpen={modal} toggle={toggle} className={className} size={'xl'}>
				<ModalBody>
					<Nav tabs>
						<NavItem>
							<NavLink className={classnames({ active: activeTab === '1' })}
											 onClick={() => { toggle2('1'); }}>
											 Diagnostico
							</NavLink>
						</NavItem>

						<NavItem>
							<NavLink className={classnames({ active: activeTab === '2' })}
											 onClick={() => { toggle2('2'); }}>
								       Descargas
							</NavLink>
						</NavItem>
					</Nav>


					<TabContent activeTab={activeTab}>
						<TabPane tabId="1">
							<DiagnosisTab />
						</TabPane>

						<TabPane tabId="2">
							<DownloadTab thumbnail={thumbnail}/>
						</TabPane>
					</TabContent>

        </ModalBody>
      </Modal>
    </div>
  );
}
function DiagnosisTab(){
	return(
		<Spinner color="info" style={{position:'absolute',margin:'auto'}} size={'xl'}/>
	);
}
function DownloadTab(thumbnail){
  let tn = thumbnail;
  console.log(tn)
	return(
		<Container>
			<Row>
      	<Col sm="6">
        <Card body>
					<CardImg top width="100%" src= {tn} alt="thumbnail" />
          <CardText>Grabación del examen.</CardText>
					<Button color='primary'> Descargar Video</Button>
        </Card>
      </Col>
      <Col sm="6">
        <Card body>
          <CardTitle>Special Title Treatment</CardTitle>
          <CardText>With supporting text below as a natural lead-in to additional content.</CardText>
          <Button>Go somewhere</Button>
        </Card>
      </Col>
     </Row>


		</Container>
	);
}
export default Diagnosis;
